impl Solution {
    pub fn min_changes(s: String) -> i32 {
        let bytes = s.as_bytes();
        let mut diff0 = 0;
        let mut diff1 = 0;

        for i in 0..bytes.len() {
            if i % 2 == 0 {
                if bytes[i] == b'0' {
                    diff1 += 1;
                } else {
                    diff0 += 1;
                }
            } else {
                if bytes[i] == b'1' {
                    diff1 += 1;
                } else {
                    diff0 += 1;
                }
            }
        }

        diff0.min(diff1)
    }
}
